import React, { Component } from 'react';

export default class Users extends Component {
  
  state = {
    kategori: 
    [
    { id:1 , kategoryName:"Ayakkabı"},
    { id:2 , kategoryName :"Elbise"}],

     
  }

    
  render() {
    
    return (
      <div className='w-25'>
        <h4>{this.props.kategorid}</h4>
        <div className="list">
          <ul>
          {
            this.state.kategori.map(kategori=> 
              <li key={kategori.id} className='pt-3' onClick={()=>this.props.click(kategori)}>{ kategori.kategoryName }</li>
              )
          }  <li>{this.props.current}</li>
           </ul>
        </div>
      </div>
    );
  }
}
